import "./CardDest.css";
import { Link } from "react-router-dom";

function CardDest(props) {
    const styles={
        background:'url(${props.Korbus})'
    };
    return (
        <div class="col-sm-6 col-md-6 col-lg-3 ">
            <Link to="/acceuil" className="mx-4 ">
                <div class="card card1" style={{ borderRadius: "15px" }}>
                    <h5>{props.title}</h5>
                    <p>{props.subtitle}</p>
                </div>
            </Link>
        </div>
    );
}

export default CardDest;
